import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import { Link } from 'react-router-dom';

function UncontrolledExample() {
    return (

        <>
            <div id="carouselExampleIndicators" class="carousel slide" data-ride="carousel">
                <ol class="carousel-indicators">
                    <li data-target="#carouselExampleIndicators" data-slide-to="0" class="active"></li>
                    <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
                    <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
                </ol>
                <div class="carousel-inner">
                    <div class="carousel-item active">
                        <img class="d-block w-100" src="Images/EVCSB.png" alt="First slide" />
                    </div>
                    <div class="carousel-item">
                        <img class="d-block w-100" src="Images/EVCSB2.png" alt="Second slide" />
                    </div>
                    <div class="carousel-item">
                        <img class="d-block w-100" src="Images/EVCSB3.png" alt="Third slide" />
                    </div>
                </div>
                <a class="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
                    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
                    <span class="sr-only">Previous</span>
                </a>
                <a class="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
                    <span class="carousel-control-next-icon" aria-hidden="true"></span>
                    <span class="sr-only">Next</span>
                </a>
            </div>
        </>

        // <Carousel style={{ width: "65%", marginTop: "4%", marginBottom: "4%", marginLeft: "auto", marginRight: "auto", display: "block", height: "30%" }} >


        //         <Carousel.Item>
        //         <a href="PDFs/tesla.pdf" target="_blank" rel = "noreferrer" >
        //             <img
        //                 className="d-block w-100"
        //                 src="Images/EVCSB.png"
        //                 alt="First slide"

        //             />
        //                  </a>

        //         </Carousel.Item>



        //         <Carousel.Item>
        //         <a href="PDFs/basic.pdf" target="_blank" rel = "noreferrer">
        //             <img
        //                 className="d-block w-100"
        //                 src="Images/EVCSB2.png"
        //                 alt="Second slide"

        //             />
        //                </a>


        //         </Carousel.Item>




        //         <Carousel.Item>
        //         <a href="PDFs/basic.pdf" target="_blank" rel = "noreferrer">
        //             <img
        //                 className="d-block w-100"
        //                 src="Images/EVCSB3.png"
        //                 alt="Third slide"

        //             />
        //         </a>
        //         </Carousel.Item>



        // </Carousel>
    );
}

export default UncontrolledExample;
